lessFormatter-examples.example-1:
@width: 10px;
@height: @width + 10px;
.bordered { border-top: dotted 1px black; border-bottom: solid 2px black; }
#menu a { width: @width; height: @height; color: #111; .bordered(); }
.post a { color: red; .bordered(); }

